webpackJsonp([1901],{"./node_modules/json-loader/index.js!./.cache/json/articles-css-css-framework-foundation.json":function(t,e){t.exports={data:{markdownRemark:{html:'<h1>CSS Framework Foundation</h1>\n<p><a href="http://foundation.zurb.com/">Foundation</a> is the one of the most advanced responsive front-end frameworks.</p>\n<h2>Getting Started</h2>\n<p>Here is a simple HTML template which includes the latest compiled and minified CSS and Javascript for the Foundation library.</p>\n<pre><code>&#x3C;!DOCTYPE html>\n&#x3C;html lang="en">\n  &#x3C;head>\n    &#x3C;meta charset="utf-8">\n    &#x3C;meta name="viewport" content="width=device-width, initial-scale=1">\n    &#x3C;title>Foundation Template&#x3C;/title>\n    &#x3C;link rel="stylesheet" href="https://cdn.jsdelivr.net/foundation/6.2.1/foundation.min.css">\n  &#x3C;/head>\n  &#x3C;body>\n    &#x3C;h1>Hello World&#x3C;/h1>\n    &#x3C;!-- Add all HTML Code here -->\n    &#x3C;script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js">&#x3C;/script>\n    &#x3C;script src="https://cdn.jsdelivr.net/foundation/6.2.1/foundation.min.js">&#x3C;/script>\n  &#x3C;/body>\n&#x3C;/html>\n</code></pre>\n<p> <kbd><a href="http://jsbin.com/gebolikiru/edit?html,output"><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/f/f9c81b35877c3e0551ca461c75b78aac80c6f48a.png"> <strong>JSBin Demo</strong></a></kbd> </p>\n<p>We have used a CDN in this example, but you can checkout other ways of installing Foundation <a href="http://foundation.zurb.com/sites/download/">here</a>.</p>\n<h2>Learning Resources</h2>\n<ul>\n<li>The official documentation for Foundation is available <a href="http://foundation.zurb.com/sites/docs/">here</a>.</li>\n<li>Checkout Foundation\'s open source GitHub repository <a href="https://github.com/zurb/foundation-sites">here</a>.</li>\n<li><img src="//forum.freecodecamp.com/images/emoji/emoji_one/point_right.png?v=2" alt=":point_right:" title=":point_right:"> List of <a href="http://foundation.zurb.com/learn/tutorials.html"><strong><code>Foundation Framework tutorials</code></strong></a>.</li>\n<li>Checkout a series by DevTips on the Foundation Grid <a href="https://www.youtube.com/playlist?list=PLqGj3iMvMa4LJo_lBMTJwAlQRElulSeL8">here</a>.</li>\n</ul>',frontmatter:{title:"CSS Framework Foundation",parent:"/home/stuart/guides/src/pages/articles/css/css-framework-foundation/index.md absPath of file"}}},pathContext:{slug:"/articles/css/css-framework-foundation/"}}}});
